import React, { Component} from 'react';
import {
    HeaderWrapper,Logo,Nav,NavItem,NavSearch,Addition,Button,SearchWrap
} from './style.js';

class Header extends Component {

    constructor(props){
        super(props);
        this.state = {
            focused: false
        }
    }

    render(){
        return (
            <HeaderWrapper>
                <Logo href='/'/>
                <Nav>
                <NavItem className='left active'>Index</NavItem>
                <NavItem className='left'>Download</NavItem>
                <NavItem className='right'>
                        <i className="iconfont">&#xe602;</i>
                    </NavItem>
                <NavItem className='right'>Login</NavItem>
                <SearchWrap>
                <NavSearch className={this.state.focused ? 'focused': ' '}></NavSearch>
                <i className="iconfont">&#xe66b;</i>
                </SearchWrap>
                </Nav>
                <Addition>
                    <Button className='reg'>Reigster</Button>              
                    <Button className='write'>
                    <i className="iconfont">&#xe63d;</i>
                        Write
                    </Button>            
                </Addition>
            </HeaderWrapper>
            );
    }
}

export default Header;
